import React from "react";
import BlueContainer from "./BlueContainer/BlueContainer";
import HeaderTop from "./HeaderTop/HeaderTop";
import Tabs from "./VerticalTabs";

function Index() {
  return (
    <div className="row">
      <div className="col-2">
        <BlueContainer />
        <Tabs />
      </div>
      <div className="col-10">
        <HeaderTop />
      </div>
    </div>
  );
}

export default Index;
